/*Table structure for table `course` */

DROP TABLE IF EXISTS `course`;

CREATE TABLE `course` (
  `id` int(38) NOT NULL,
  `course` varchar(50) default NULL,
  `description` varchar(2000) default NULL,
  `created` date default NULL,
  `createdid` varchar(38) default NULL,
  `updated` date default NULL,
  `updatedid` varchar(38) default NULL,
  `price` int(38) default NULL,
  `countTrainee` int(38) default NULL,
  `starHits` int(38) default NULL,
  `imagePath` varchar(100) default NULL,
  `Heading1` varchar(100) default NULL,
  `para1` varchar(5000) default NULL,
  `Heading2` varchar(100) default NULL,
  `para2` varchar(5000) default NULL,
  `Heading3` varchar(100) default NULL,
  `para3` varchar(5000) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `course` */

insert  into `course`(`id`,`course`,`description`,`created`,`createdid`,`updated`,`updatedid`,`price`,`countTrainee`,`starHits`,`imagePath`,`Heading1`,`para1`,`Heading2`,`para2`,`Heading3`,`para3`) values (100,'Java','Java is a programming language and computing platform first released by Sun Microsystems in 1995. There are lots of applications and websites that will not work unless you have Java installed.Java is a programming language.',NULL,NULL,NULL,NULL,50000,75,4,'assets/images/demo-content/java-red.jpg','Learn Everything You Need to Know About Web Development Even If You\'ve Never Programmed Before!','When Java was developed initially as OAK even its developers were not sure in which direction the technology will grow. And actually Java has taken an unexpected turn around as a development technology. It started its journey with embedded applications but people found it somewhat slow when compare to C++. Java made foray into web in the form of applets and ruled the world for sometime. But then came enterprise era with crusade of .NET and J2EE. In this article let us examine possible directions where there are chances Java will grow as development technology.','For Thick Clients','Now-a-day people expect great performance from applications which are hosted over the net on some remote servers. Implementing thick client is one of the solutions to achieve better performance for such applications. Thick client means the implementation where client itself carries out some operations without interrupting server for small things. Java applets are most competitive candidate for thick clients. They can offer full-fledged stand-alone functionalities even though downloaded from a remote server.','As a Base','To develop advanced components and tools one always need to use the base library. J2SE provides basic libraries like language features, utilities and networking APIs. Even J2EE and other Java technologies are extended or developed over the top of such base libraries. With the changing times, J2SE or Core Java is not going to lose its importance.'),(101,'HTML5/CSS3','HTML5 is a markup language used for structuring and presenting content on the World Wide Web. It was finalized, and published, on 28 October 2014 by the World Wide Web Consortium.',NULL,NULL,NULL,NULL,10000,85,3,'assets/images/demo-content/html-css.jpg',NULL,NULL,NULL,NULL,NULL,NULL),(102,'JQuery','jQuery is a fast and concise JavaScript library created by John Resig in 2006. jQuery simplifies HTML document traversing, event handling, animating, and Ajax interactions for Rapid Web Development.',NULL,NULL,NULL,NULL,8000,10,3,'assets/images/demo-content/jquery.jpg',NULL,NULL,NULL,NULL,NULL,NULL),(103,'Spring','Spring framework is an open source Java platform that provides comprehensive infrastructure support for developing robust Java applications very easily and very rapidly.',NULL,NULL,NULL,NULL,15000,20,4,'assets/images/demo-content/spring.jpg',NULL,NULL,NULL,NULL,NULL,NULL),(104,'Angular Js','AngularJS is a JavaScript framework. It can be added to an HTML page with a <script> tag.\nAngularJS extends HTML attributes with Directives, and binds data to HTML with Expressions.','2017-01-21',NULL,NULL,NULL,10000,15,5,'assets/images/demo-content/angular.png',NULL,NULL,NULL,NULL,NULL,NULL);

