/*Table structure for table `profile_role_permission` */

DROP TABLE IF EXISTS `profile_role_permission`;

CREATE TABLE `profile_role_permission` (
  `profile_id` int(38) default NULL,
  `role` varchar(50) default NULL,
  `created` date default NULL,
  `createdId` varchar(38) default NULL,
  `updated` date default NULL,
  `updatedId` varchar(38) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

