insert  into `profile_role_permission`(`profile_id`,`role`,`created`,`createdId`,`updated`,`updatedId`) values (22,'ROLE_MEMBER',NULL,NULL,NULL,NULL),(1,'ROLE_MEMBER',NULL,NULL,NULL,NULL),(1,'ROLE_ADMIN',NULL,NULL,NULL,NULL);

/*Table structure for table `rel_profile_course` */

DROP TABLE IF EXISTS `rel_profile_course`;

CREATE TABLE `rel_profile_course` (
  `id` int(38) NOT NULL,
  `profile_id` int(38) default NULL,
  `course_id` int(38) default NULL,
  `created` date default NULL,
  `createdid` varchar(38) default NULL,
  `updated` date default NULL,
  `updatedid` varchar(38) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

