/*Table structure for table `rel_profile_role` */

DROP TABLE IF EXISTS `rel_profile_role`;

CREATE TABLE `rel_profile_role` (
  `id` int(38) NOT NULL auto_increment,
  `profile_id` int(38) default NULL,
  `role_id` varchar(100) default NULL,
  `created` date default NULL,
  `createdid` varchar(38) default NULL,
  `updated` date default NULL,
  `updatedid` varchar(38) default NULL,
  PRIMARY KEY  (`id`),
  KEY `fk_profile_id` (`profile_id`),
  CONSTRAINT `fk_profile_id` FOREIGN KEY (`profile_id`) REFERENCES `profile` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

